window.bookSummaryJSON = "<p><i>New York Times</i> best-selling author Dianne Duvall brings listeners the first novel in a thrilling new sci-fi romance series full of action, intrigue, humor, and romance.</p> <p>When an ally reveals that his younger sister was seized and is being held prisoner on Earth, Taelon descends upon the blue planet, intent on freeing her and exacting vengeance. However, all does not go as planned. Before he can find her, Taelon is captured and becomes the subject of torturous experiments. For what feels like an eternity, all he knows is pain and fury...until a mind tentatively touches his own and a woman's voice forever changes his world.</p> <p>After suffering tragic losses, Lisa is finally beginning to carve out a future for herself when chance sends her to the Anomalous Cognition Research Institute. What at first appears to be a benign organization instead turns out to be a government facility harboring a much darker intent. Lisa discovers this too late and soon becomes the unwilling subject of a terrifying experiment. Just as fear and desperation threaten to consume her, a deep, compelling voice penetrates the looming insanity and lends her hope.</p> <p>Contains mature themes.</p>"; 
